(function() {
    'use strict';

    Polymer({
      is: 'sapiens-multiple-input',

      properties: {
        items: {
          type: Array,
          notify: true,
          observer: 'itemsChanged'
        },

        selectedItems: {
          type: Array,
          notify: true,
          value: []
        },

        small: Boolean
      },

      itemsChanged: function(items){
        if (this.small){
          this.set('type', 'small');
        }else{
          this.set('type', 'normal')
        }

      },

      confirm: function(){
        if (this.outro){
          this.push('selectedItems', this.outro);
          this.set('outro', '');   
        }
      },

      add: function(evt){   
        if (evt.model.get('item').toLowerCase().indexOf("outr") >= 0){
          this.$.modal.open();
        }else{
          this.push('selectedItems', evt.model.get('item'));       
        }

        this.$.menu.selected = -1;

        this.updateStyles();
      },

      remove: function(item){
        var index = this.selectedItems.indexOf(item);

        this.splice('selectedItems', index, 1);
      }
    });
  })();
