(function() {
    'use strict';

    Polymer({
      is: 'sapiens-carga-docente',

      properties: {
        docentes: {
          observer: '_docentesChanged'
        }
      },
      
      _docentesChanged: function(n, old){

        var tableData = [];

        this.docentes.forEach(function(docente){
          tableData.push({
            nome: docente.nomecompleto,
            area: docente.area,
            carga: Math.ceil(docente.carga)
          });
        });

        this.tableData = tableData;
      },

      ready: function(){
        
        var ref = new Firebase('https://sapiens.firebaseio.com/servidores');
        var self = this;

        ref
          .orderByChild('docente')
          .equalTo(true)
          .on('value', function(snapshotDocentes){
            if (snapshotDocentes.exists()){
              var docentes = snapshotDocentes.val().toArray();
              
              docentes.forEach(function(docente, i){
                if (!docente.carga){
                  docentes[i].carga = 0;
                }
              });
              
              self.set('docentes', docentes);
            }
        })

        this.columns = [
          {
            title: 'Nome',
            number: false,
            column: 'nome',
            hidden: false
          },

          {
            title: 'rea',
            number: false,
            column: 'area',
            hidden: false
          },          

          {
            title: 'CH',
            number: true,
            column: 'carga',
            formatter: function(value){
              return ~~value;
            },
            hidden: false
          }
        ];
      }
    });
  })();